import NavBar from '../components/NavBar'; // Navigate up one folder
import Dashboard from './Dashboard';       // Local file
import AddTenant from './AddTenant';       // Local file
import TenantList from '../components/TenantList'; // Navigate up one folder

const Tenants = () => {
    return (
        <div>
            <NavBar />
            <div className="p-4 max-w-4xl mx-auto">
                <h1 className="text-2xl font-bold mb-4">Tenants</h1>
                <TenantList />
            </div>
        </div>
    );
};

export default Tenants;
